import React from "react";
import "./PhotoGrid.css";

const PhotoGrid = ({ photos }) => {
    // const { links, urls, alt_description } = photo;
    Object.entries(photos).map((photo) => {
        console.log(photo[0].urls.regular);
    });
    return (
        <div className="photo-grid">
            {Object.entries(photos).map((key, photo) => (
                <div key={key}>
                    < img src={photo[0].urls.regular} alt={photo[0].alt_description} />
                </div>
            ))}
        </div>
    );
};

export default PhotoGrid;
